import React, { useEffect } from 'react';
import axios from 'axios';
function Home() {
  useEffect(() => {
    getProducts();
  }, []);

  async function getProducts() {
    const url = 'http://localhost:3000/api/products';
    const response = await axios.get(url);

    console.log(response.data);
  }
  return (
    <>
      <h1>test</h1>
    </>
  );
}

export default Home;
